import React from 'react';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import ListSubheader from '@material-ui/core/ListSubheader';
import AssignmentIcon from '@material-ui/icons/Assignment';
import HomeIcon from '@material-ui/icons/Home';
import TimelineIcon from '@material-ui/icons/Timeline';
import StarRateIcon from '@material-ui/icons/StarRate';
import ChatIcon from '@material-ui/icons/Chat';

const homeObj = {
  key: 'HOME',
  text: "ホーム"
};

const loadObj = {
  key: 'Load',
  text: '転職までの経緯'
};

const skillsObj = {
  key: 'SKILLS',
  text: 'スキルセット'
};

const botObj = {
  key: 'CHATBOT',
  text: 'チャットボット'
};

export { homeObj, loadObj, skillsObj, botObj };

export function MainListItems(props) {

  return (

    <div>
      <ListItem button onClick={props.updateStateFunc[0]}>
        <ListItemIcon>
          <HomeIcon />
        </ListItemIcon>
        <ListItemText primary={homeObj.text} />
      </ListItem>
      <ListItem button onClick={props.updateStateFunc[1]}>
        <ListItemIcon>
          <TimelineIcon />
        </ListItemIcon>
        <ListItemText primary={loadObj.text} />
      </ListItem>
      <ListItem button onClick={props.updateStateFunc[2]}>
        <ListItemIcon>
          <StarRateIcon />
        </ListItemIcon>
        <ListItemText primary={skillsObj.text} />
      </ListItem>
      <ListItem button onClick={props.updateStateFunc[4]}>
        <ListItemIcon>
          <ChatIcon />
        </ListItemIcon>
        <ListItemText primary={botObj.text} />
      </ListItem>
    </div>
  )
}

export const secondaryListItems = (
  <div>
    <ListSubheader inset>Saved reports</ListSubheader>
    <ListItem button>
      <ListItemIcon>
        <AssignmentIcon />
      </ListItemIcon>
      <ListItemText primary="Current month" />
    </ListItem>
    <ListItem button>
      <ListItemIcon>
        <AssignmentIcon />
      </ListItemIcon>
      <ListItemText primary="Last quarter" />
    </ListItem>
    <ListItem button>
      <ListItemIcon>
        <AssignmentIcon />
      </ListItemIcon>
      <ListItemText primary="Year-end sale" />
    </ListItem>
  </div>
);
